import React, { useState } from 'react'
import { Accordion } from 'reactstrap'

const ListItem = () => {
    const [open,setOpen]=useState('1')
    const toggle = (id) => {
        if (open === id) {
          setOpen();
        } else {
          setOpen(id);
        }
      };
  return (
    <Accordion open={open} toggle={toggle}>
    </Accordion>
  )
}

export default ListItem
